-- Table structure for fin_bank_card
-- ----------------------------
DROP TABLE IF EXISTS `fin_bank_card`;
CREATE TABLE `fin_bank_card`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'users表ID',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , uid',
  `card_category` tinyint(4) UNSIGNED NOT NULL DEFAULT 3 COMMENT '银行卡类型 3: 个人银行卡 2: 对公账户 5:法人个人银行卡',
  `card_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '银行卡号',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员名 or 法人姓名',
  `phone` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '银行预留手机',
  `identity_type` tinyint(4) UNSIGNED NOT NULL COMMENT '个人or法人证件类型 1: 身份证(目前只有这个). 2:护照   等等具体看文档',
  `identity_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '个人or法人证件号码,',
  `union_bank` bigint(13) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付行号，12位数字, 必填',
  `validate` int(5) UNSIGNED NULL DEFAULT NULL COMMENT '格式为月年；如0321，2位月2位年',
  `cvv2` int(5) NULL DEFAULT NULL COMMENT '3位数字',
  `status` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '绑定结果 0: 请求中  10:成功 40: 失效/解绑',
  `trance_num` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '流水号',
  `trans_date` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '申请时间	YYYYMMDD',
  `bank_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '银行名称	',
  `bank_code` int(16) UNSIGNED NOT NULL COMMENT '银行代码',
  `card_type` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '1储蓄卡 2信用卡',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `delete_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `trance_num`(`trance_num`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 178 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'users 绑定银行卡表' ROW_FORMAT = Dynamic;

