-- ----------------------------
-- Table structure for fin_ccb_accounting_rules
-- ----------------------------
DROP TABLE IF EXISTS `fin_ccb_accounting_rules`;
CREATE TABLE `fin_ccb_accounting_rules`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `app_id` char(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '应用id',
  `biz_uid` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , uid',
  `clrg_rule_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '清算规则编号',
  `mkt_mrch_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商家编号',
  `seq_no` tinyint(4) NOT NULL DEFAULT 1 COMMENT '顺序号',
  `mkt_id` char(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '市场编号',
  `rule_nm` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '清算规则名称',
  `rule_dsc` varchar(1200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '清算规则描述',
  `sub_acc_cyc` tinyint(4) NOT NULL DEFAULT 1 COMMENT '分账周期  1-日；2-月；3-月末',
  `clrg_dlay_dys` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '1' COMMENT '当分账周期为1-日，2-月时必输, 1-日，取值为1-100；2-月，取值为1-31；',
  `clrg_mode` tinyint(4) NOT NULL DEFAULT 1 COMMENT '1-翻盘式, 2-滚动式；3-时间自定义式',
  `clrg_mtdcd` tinyint(4) NOT NULL DEFAULT 2 COMMENT '1固定金额. 2固定比例, 3先固定金额再比例',
  `clrg_pctg` tinyint(4) NOT NULL DEFAULT 0 COMMENT '清算比例,  当【清算方式代码】为按比例时，此项必输',
  `mkt_nm` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '市场名称',
  `efdt` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '生效日期',
  `expdt` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '失效日期',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `is_gather` tinyint(255) NOT NULL DEFAULT 0 COMMENT '汇总计算订单金额后分账 0: 不汇总  1:汇总',
  `delete_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '删除时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 83 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '建行惠市宝分账规则明细表\r\n' ROW_FORMAT = Dynamic;

