  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 39 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '分账明细表 读取分账明细文件 文件名称：市场编号-日期-det.txt' ROW_FORMAT = Dynamic;

