-- ----------------------------
-- Table structure for fin_order_entry
-- ----------------------------
DROP TABLE IF EXISTS `fin_order_entry`;
CREATE TABLE `fin_order_entry`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'users表ID',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , uid',
  `biz_order_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统订单号',
  `allinpay_order_no` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay订单号',
  `payer_id` char(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '付款人(发起人),  传递给allinpay的bizUserId格式为 unique_id +biz_id',
  `order_entry_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '0:待支付 10:allinpay异步支付完成 20:财务确认收款 30: 部分代付 40:部分代付确认 50: 分账完成 60: 财务确认订单完成',
  `amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '订单总金额 单位:分',
  `allinpay_pay_no` varchar(22) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay交易单号',
  `fee` bigint(20) NOT NULL DEFAULT 0 COMMENT '手续费, 如果无填0',
  `remain_amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '可以分账的剩余金额 单位:分',
  `order_type` tinyint(4) NOT NULL DEFAULT 20 COMMENT '10: 充值订单  20:托管代收订单',
  `public_account_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '公管账户id, 格式同payer_id',
  `account_set_no` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '账户集编号',
  `biz_goods_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商户系统商品编号',
  `member_type` tinyint(4) NOT NULL DEFAULT 3 COMMENT '付款人会员类型 3: 个人会员 2: 企业会员',
  `goods_type` tinyint(5) NOT NULL DEFAULT 3 COMMENT '商品类型 2: 虚拟商品 3: 实物商品 4: 线下服务 5: 跨境商品(需要录入商品参数) 90:营销活动 99: 其他',
  `trade_code` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '3001' COMMENT '业务码 -必传  参照https://cloud.allinpay.com/ts-cloud-dev-web/#/apiCenter/index?params=y&key=293',
  `validate_type` int(11) NOT NULL DEFAULT 1 COMMENT '交易验证方式, 0:无验证 1:短信验证 2:支付密码',
  `front_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '前台通知地址',
  `back_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '后台通知地址',
  `order_expire_datetime` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '订单过期时间 yyyy-MM-dd HH:mm:ss 控制订单可支付时间，订单最长时效为24小时，即过期时间不能大于订单创建时间24小时；',
  `pay_method` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '支付方式 参照 https://cloud.allinpay.com/ts-cloud-dev-web/#/apiCenter/index?params=y&key=265',
  `industry_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '行业代码 https://cloud.allinpay.com/ts-cloud-dev-web/#/apiCenter/index?params=y&key=294',
  `industry_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '行业名称 https://cloud.allinpay.com/ts-cloud-dev-web/#/apiCenter/index?params=y&key=294',
  `source` tinyint(4) NOT NULL DEFAULT 1 COMMENT '访问终端类型 1:手机端 2: PC端',
  `goods_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品名称 非必传',
  `goods_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商品描述 非必传',
  `summary` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '摘要 非必传 交易内容摘要。最多20个字符',
  `extend_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '扩展参数 非必传 接口将原样返回，最多50个字符，不可包含“|”特殊字符',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `show_order_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统的业务订单号(例如 MA1234567)',
  `show_user_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '业务系统用户名',
  `confirm_status` int(10) NOT NULL DEFAULT 0 COMMENT '财务确认按钮:0 未确认 1 已确认',
  `open_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `ittparty_jrnl_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '发起方流水号',
  `py_trn_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '支付流水号',
  `sub_ordr_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '子订单编号 惠市宝生成 退款时用',
  `pay_qr_code` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'CCB生成的支付链接',
  `type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '1 allinpay 2建行CCB',
  `result_msg` json NULL COMMENT 'CCB接口返回值',
  `refund_status` tinyint(1) UNSIGNED NULL DEFAULT 1 COMMENT '退款状态 1未退款 2部分退款 3全部退款',
  `refunded_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '已退款金额',
  `refunding_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款中金额',
  `ccb_reconciliation_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '建行分账金额',
  `is_push` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否推送业务系统  0否1是',
  `reconciliation_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '对账状态 0未对账  1正常 2异常',
  `is_reconciliation` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '自动对账状态  0未对账 1已对账',
  `pay_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '支付时间',
  `transfer_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分账金额不够分，转账的金额',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UNQ_ORDER_NO`(`biz_order_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1416 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '入账订单(充值+托管代收订单)' ROW_FORMAT = Dynamic;

