-- Records of fin_order_entry
-- ----------------------------

-- ----------------------------
-- Table structure for fin_order_process
-- ----------------------------
DROP TABLE IF EXISTS `fin_order_process`;
CREATE TABLE `fin_order_process`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT 0 COMMENT 'users表ID',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , 收款人',
  `biz_order_process_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商户分账订单号',
  `process_num` int(6) NOT NULL DEFAULT 0 COMMENT '同一分账订单下的编号',
  `order_process_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '0 待回调  20: 后台财务确认 30: allInPay异步回调完成 ',
  `allinpay_order_no` char(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay订单号',
  `order_entry_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '入账订单号 order_entry表biz_order_no',
  `amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '订单金额 单位:分',
  `allinpay_pay_no` varchar(22) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay交易单号',
  `fee` bigint(20) NOT NULL DEFAULT 0 COMMENT '手续费, 如果无填0',
  `receiver_id` bigint(20) NOT NULL DEFAULT 0 COMMENT '付款人id, 格式同payer_id',
  `member_type` tinyint(4) NOT NULL DEFAULT 3 COMMENT '收款人会员类型 3: 个人会员 2: 企业会员',
  `account_set_no` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '账户集编号',
  `back_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '后台通知地址',
  `source` tinyint(4) NOT NULL DEFAULT 1 COMMENT '访问终端类型 1:手机端 2: PC端',
  `extend_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '扩展参数 非必传 接口将原样返回，最多50个字符，不可包含“|”特殊字符',
  `remark` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '备注，最长50个字符',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `trade_code` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '4001' COMMENT '业务码 -必传  参照https://cloud.allinpay.com/ts-cloud-dev-web/#/apiCenter/index?params=y&key=293',
  `extend_params` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统的扩展参数, 原样返回给业务系统',
  `show_order_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统的业务订单号(例如 MA1234567)',
  `show_user_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '业务系统用户名',
  `delete_time` int(10) NOT NULL DEFAULT 0 COMMENT '0：未删除，记录删除时间',
  `confirm_status` int(10) NOT NULL DEFAULT 0 COMMENT '财务确认按钮:0 未确认 1 已确认',
  `clrg_rule_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '分账规则编号',
  `cmdty_ordr_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '子订单编号',
  `mkt_mrch_id` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商家编号,20位商家编号该字段由银行在正式上线前提供，测试阶段有测试数',
  `txnamt` decimal(21, 0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '实付金额',
  `finance_summary_detail_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分账明细对应id',
  `type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '1 allinpay 2惠市宝',
  `is_reconciliation` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '自动对账状态  0未对账 1已对账',
  `reconciliation_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '对账状态 0未对账  1正常 2异常',
  `ccb_reconciliation_amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '建行分账金额',
  `is_push` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否推送业务系统  0否1是',
  `clrg_stcd` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '分账状态 2-分账成功 4分账日常',
  `remain_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '可以分账的剩余金额 单位:分',
  `refunded_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '已退款金额',
  `refunding_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款中金额',
  `refund_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '退款状态 退款状态 1未退款 2部分退款 3全部退款',
  `rate` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分账规则比例',
  `seq_no` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分账规则排序',
  `split_time` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分账日期',
  `transfer_amount` bigint(21) UNSIGNED NOT NULL DEFAULT 0 COMMENT '分账金额不够分，转账的金额',
  `transfer_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '转账类型  0未转账  10 线上转账 20 ，线下转账，手动打款，30不转账（没有补款，或者财务确认不打款）',
  `transfer_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '转账状态  0未转账  10 转账成功 20转账失败 30 转账中，等待回调',
  `is_auto_fin` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '是否财务确认分账 1无需财务确认，自动分账  2需要财务确认分账',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2994 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '代付预处理订单表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of fin_order_process
-- ----------------------------

-- ----------------------------
-- Table structure for fin_order_refund
-- ----------------------------
DROP TABLE IF EXISTS `fin_order_refund`;
CREATE TABLE `fin_order_refund`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'users表ID',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
