  `refund_type` tinyint(2) UNSIGNED NOT NULL DEFAULT 1 COMMENT '退款方式 1.D1 ,2.D0 ',
  `refund_list` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '托管代收订单中的收款人的退款金额',
  `amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '本次退款金额 单位（分）',
  `coupon_amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '代金券退款金额 单位（分）',
  `fee_amount` bigint(21) NOT NULL DEFAULT 0 COMMENT '手续费退款金额 单位（分）',
  `extend_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '扩展参数 非必传 接口将原样返回，最多50个字符，不可包含“|”特殊字符',
  `audit_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '审核状态 0.等待审核 20.审核通过 40.审核驳回',
  `pay_fail_message` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '支付失败信息，只有失败才有',
  `biz_back_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商户通知地址',
  `back_status` tinyint(4) NOT NULL DEFAULT 0 COMMENT '通知状态 0.未通知 10.等待通知 20.通知成功 40.通知失败',
  `py_trn_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '支付流水号',
  `type` tinyint(1) UNSIGNED NOT NULL DEFAULT 1 COMMENT '1 allinpay 2建行CCB',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `show_user_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '业务系统用户名',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UNQ_ORDER_NO`(`biz_order_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 312 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单退款表' ROW_FORMAT = Dynamic;

