-- ----------------------------
-- Table structure for fin_picture
-- ----------------------------
DROP TABLE IF EXISTS `fin_picture`;
CREATE TABLE `fin_picture`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'users表ID',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , uid',
  `pic_type` tinyint(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '影印件类型\r\n1-营业执照（必传）\r\n2-组织机构代码证（三证时必传）\r\n3-税务登记证（三证时必传）\r\n4-银行开户证明（非必传，上传《银行开户许可证》或《基本存款账户信息》等可证明平台银行账号和户名的文件）\r\n5-机构信用代码（非必传）\r\n6-ICP备案许可（非必传）\r\n7-行业许可证（非必传）\r\n8-身份证正面（人像面）（必传）\r\n9-身份证反面（国徽面）（必传）',
  `pic_base64` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '影印件图片地址',
  `pic_size` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '影印件图片大小, 单位b',
  `pic_status` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '上传结果 1-成功; 2-失败',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 218 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '附件采集表(影印件采集接口)' ROW_FORMAT = Dynamic;

