-- Records of fin_picture
-- ----------------------------

-- ----------------------------
-- Table structure for fin_real_auth
-- ----------------------------
DROP TABLE IF EXISTS `fin_real_auth`;
CREATE TABLE `fin_real_auth`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT 0 COMMENT 'users表ID',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , uid',
  `member_type` tinyint(4) NOT NULL DEFAULT 3 COMMENT '会员类型 3: 个人会员 2: 企业会员',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员名 or 企业名称',
  `legal_name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '法人姓名, 必填',
  `legal_phone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '法人手机号',
  `identity_type` tinyint(4) NOT NULL DEFAULT 1 COMMENT '个人or法人证件类型 1: 身份证(目前只有这个). 2:护照   等等具体看文档',
  `identity_no` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '个人or法人证件号码,',
  `auth_type` tinyint(4) NOT NULL DEFAULT 2 COMMENT '认证类型1:三证2:一证',
  `uni_credit` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '统一社会信用（一证）认证类型为2时必传',
  `business_license` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '营业执照号（三证）认证类型为1时必传',
  `organization_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '组织机构代码（三证）认证类型为1时必传',
  `tax_register` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '税务登记证（三证）认证类型为1时必传',
  `parent_bank_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '开户银行名称, 严格参照文档说明, 注：测试环境仅支持工农中建交。',
  `account_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '企业对公账户, 必填',
  `bank_city_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '开户行地区代码, 选填',
  `bank_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '开户行支行名称, 必填',
  `union_bank` bigint(13) NOT NULL DEFAULT 0 COMMENT '支付行号，12位数字, 必填',
  `telephone` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '联系电话, 选填',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '住所地或者工作单位地址：不少于10个中文汉字',
  `identity_begin_date` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '证件有效开始日期, 选填',
  `identity_end_date` int(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '证件有效截止日期, 选填',
  `company_info_status` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT '企业信息审核结果 0.待审核 1.审核成功 2.审核失败',
  `allinpay_fail_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay 验证失败原因',
  `allinpay_remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay 备注',
  `ocr_reg_num` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'OCR识别与企业工商认证信息是否一致 0:未审核1:一致 2:不一致  ',
  `ocr_id_card` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'OCR识别与企业法人实名信息是否一致 0:未审核 1:一致 2:不一致',
  `ocr_result_info` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'OCR对比结果',
  `biz_back_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商户回调通知url',
