-- ----------------------------
-- Table structure for fin_transfer
-- ----------------------------
DROP TABLE IF EXISTS `fin_transfer`;
CREATE TABLE `fin_transfer`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT,
  `uid` int(11) UNSIGNED NOT NULL COMMENT 'users表ID',
  `app_uid` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '',
  `biz_batch_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '批量转账商户批次号，只有批量转账才有值',
  `biz_transfer_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '商户系统转账订单号，商户系统唯一',
  `allinpay_order_no` char(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay订单号',
  `source_account_set_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '源账户集编号',
  `target_account_set_no` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '目标账户集编号',
  `amount` bigint(21) UNSIGNED NOT NULL COMMENT '金额 单位：分',
  `type` tinyint(1) UNSIGNED NOT NULL DEFAULT 10 COMMENT '转账类型  10个人转账 20 批量转账',
  `transfer_status` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '转账状态  0未转账  10 转账成功 20转账失败 30 转账中，等待回调 个人转账是同步的，批量转账是异步的',
  `extend_info` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '扩展信息',
  `source_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '来源类型  用于回调10 分账触发',
  `source_id` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '来源id 用于回调查询业务id',
  `create_time` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `update_time` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `delete_time` int(10) UNSIGNED NOT NULL DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UNQ_ORDER_NO`(`biz_transfer_no`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 40 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '平台转账表' ROW_FORMAT = Dynamic;

