-- Records of fin_transfer
-- ----------------------------

-- ----------------------------
-- Table structure for fin_users
-- ----------------------------
DROP TABLE IF EXISTS `fin_users`;
CREATE TABLE `fin_users`  (
  `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `app_uid` int(11) NOT NULL DEFAULT 0 COMMENT '应用会员表id',
  `biz_uid` char(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统传递的用户id , uid',
  `biz_user_id` char(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '传递给allinpay的bizUserId格式为 unique_id +biz_id',
  `allinpay_uid` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT 'allinpay创建会员之后返回的 userId',
  `name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员名 or 企业名称',
  `member_type` tinyint(4) NOT NULL DEFAULT 3 COMMENT '会员类型 3: 个人会员 2: 企业会员',
  `all_amount` char(21) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '会员总余额',
  `freezen_amount` char(21) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '0' COMMENT '会员冻结的余额',
  `real_auth_status` tinyint(4) UNSIGNED NOT NULL DEFAULT 10 COMMENT '实名状态 10:未实名 20:审核中 30:实名通过 40: 实名失败',
  `sign_contract_status` tinyint(4) UNSIGNED NOT NULL DEFAULT 10 COMMENT '签约状态 10:未签约 20:审核中 30:签约通过 40: 签约失败',
  `source` tinyint(4) NOT NULL DEFAULT 1 COMMENT '访问终端类型 1:手机端 2: PC端',
  `platform_id` int(11) NOT NULL DEFAULT 1 COMMENT '平台会员ID 默认:1  中装速配',
  `mobile` bigint(12) UNSIGNED NOT NULL DEFAULT 0 COMMENT '手机号',
  `real_auth_id` int(11) NOT NULL DEFAULT 0 COMMENT '实名认证 0: 未认证  除1外为认证资料表ID(real_auth表)',
  `pay_password` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '支付密码',
  `status` tinyint(4) UNSIGNED NOT NULL DEFAULT 10 COMMENT '状态 10:正常 40:已锁定 ',
  `extend_param` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '扩展参数',
  `create_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `biz_nickname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '业务系统身份标识',
  `is_import` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否导入 1是 0否',
  `sub_acct_no` char(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '会员子账户, 用于大额支付',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `UNQ_BIZID`(`biz_user_id`) USING BTREE COMMENT 'UUID 唯一'
) ENGINE = InnoDB AUTO_INCREMENT = 27420 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '会员用户表' ROW_FORMAT = Dynamic;

