  `white_status` tinyint(4) UNSIGNED NOT NULL COMMENT '白名单是否开启',
  `is_test` tinyint(4) UNSIGNED NOT NULL COMMENT '是否测试应用 0: 测试 1: 正式',
  `status` tinyint(4) UNSIGNED NOT NULL DEFAULT 10 COMMENT '状态 10:正常 40:已锁定 ',
