  `update_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '修改时间',
  `expires_time` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '到期时间 0: 永不到期',
  `system_type` tinyint(1) UNSIGNED NOT NULL DEFAULT 0 COMMENT '系统类型 详见model',
  `is_auto_fin` tinyint(1) UNSIGNED NOT NULL DEFAULT 2 COMMENT '是否自动分账 1是 2否',
  PRIMARY KEY (`app_uid`) USING BTREE,
