  `user_level_id` int(22) NOT NULL DEFAULT 0 COMMENT '等级id',
  `type` tinyint(3) NOT NULL DEFAULT 1 COMMENT '权益类型，1-会员包邮，2-分享商品获得分红,3-等级链条获得分佣,4-购买会员获得分佣,5-链条找会员模式,6-订单找等级会员模式',
  `first_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '一级比例',
  `second_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '二级比例',
  `third_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '三级比例',
  `is_enable` tinyint(1) NOT NULL DEFAULT 0 COMMENT '权益状态，1-开启，0-关闭',
  `create_time` int(10) NOT NULL DEFAULT 0,
  `update_time` int(10) NOT NULL DEFAULT 0,
  `case_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '方案，10-充值，20-年费方案',
  `case_rate` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '方案，分佣返利',
  `bonus_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '分红方式，10-一次性',
  `bonus_first_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '分红一级比例',
  `bonus_second_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '分红二级比例',
  `bonus_third_rate` decimal(5, 2) NOT NULL DEFAULT 0.00 COMMENT '分红三级比例',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `shop_uid_level_id`(`shop_uid`, `user_level_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商家会员等级权益' ROW_FORMAT = DYNAMIC;

