-- ----------------------------
-- Table structure for zsp_users_level_order
-- ----------------------------
DROP TABLE IF EXISTS `zsp_users_level_order`;
CREATE TABLE `zsp_users_level_order`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '订单号',
  `shop_uid` int(11) NOT NULL DEFAULT 0 COMMENT '商家uid',
  `user_id` int(11) NOT NULL DEFAULT 0 COMMENT '会员uid',
  `old_level_id` int(11) NOT NULL DEFAULT 0 COMMENT '当前等级',
  `old_level_pay_rules_id` int(11) NOT NULL DEFAULT 0 COMMENT '当前等级详情id',
  `level_id` int(11) NOT NULL DEFAULT 0 COMMENT '等级id',
  `level_pay_rules_id` int(11) NOT NULL DEFAULT 0 COMMENT '等级详情id',
  `effective_time` int(11) NOT NULL DEFAULT 0 COMMENT '等级明细 期限',
  `type` tinyint(3) NOT NULL DEFAULT 1 COMMENT '类型，1-发起购买，2-手动设置',
  `pay_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '购买金额',
  `status` tinyint(3) NOT NULL DEFAULT 0 COMMENT '支付成功，0-未支付，1-已支付',
  `commission_rate` decimal(5, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '分拥比例，0：不需要分佣',
  `is_separate` tinyint(4) NOT NULL DEFAULT 0 COMMENT '0:未分成; 10:已模拟分成; 20:取消分成; 40:分佣完成',
  `shop_distribution` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '分佣配置表',
  `create_time` int(10) NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int(10) NOT NULL DEFAULT 0 COMMENT '修改时间',
  `open_time` int(10) NOT NULL DEFAULT 0 COMMENT '等级开通时间',
  `is_dxe` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否来自店小二，0-否，1-是',
  `is_refund_status` tinyint(2) NOT NULL DEFAULT 0 COMMENT '是否已经退款，0-否，1-是',
  `is_show` tinyint(2) NOT NULL DEFAULT 1 COMMENT '是否显示，0-不显示，1-显示',
  `user_coupon_id` int(11) NOT NULL DEFAULT 0 COMMENT 'zsp_user_coupon_record表主键',
  `deduction_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '优惠金额',
  `invoice_id` int(10) NOT NULL DEFAULT 0 COMMENT '发票ID,0：表示不开发票 ',
  `effective_time_unit` tinyint(4) NOT NULL DEFAULT 0 COMMENT '有效期单位默认 0月 1日 2年',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `order_sn`(`order_sn`) USING BTREE,
  INDEX `shop_uid`(`shop_uid`, `user_id`, `level_id`, `level_pay_rules_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '商家会员等级购买订单记录' ROW_FORMAT = DYNAMIC;

